Searches for an object. If the amount of objects matches the number that is stored in the amount given in arg 3, that object will be pushed into the STACK given in arg 2, and variable Tmp/Result (0) is set to true.
The newest object will always be 0, and older objects can be accessed incrementally.
Note that this function only searches for objects that were created by your character, and which haven't been marked for destruction/koware yet.

The following example will create kidan_5D if none exist already.
[searchActionName: s32(kidan_5D), (NULL), int(0)
ifNot: var(Result) {
	createObject: s32(kidan_5D), (ZERO)
} endIf:]
This example increases the Y position (height) of the second kidan_5D, provided it exists.
Note that which exact object is "second kidan_5D" changes when you spawn a new kidan_5D. If you'd like this "second kidan_5D" to always refer to the same object, then you'll have to keep track of that yourself with proper STACK manipulation.
[searchActionName: s32(kidan_5D), (STACK0), int(1)
if: var(Result) {
	applyTo: (STACK0) {
		addYPosition: 120000
	} endApply:
} endIf:]

